import React, { memo, useState } from "react";

const base64 = ""

const Base64Images: React.FC = () => {
  // 生成100个Base64图片的示例
  const base64Images = Array.from({ length: 1000 }, (_, index) => {
    return `data:image/png;base64,${base64}`;
  });

  const [counts, setCounts] = useState(base64Images.map(()=> 0))

  return (
    <div>
      <h1>Base64 Images</h1>
      <div style={{ display: "flex", flexWrap: "wrap", }} className="flex-col">
        {base64Images.map((src, index) => (
          <ReviewBase64 key={index} src={src} index={index} count={counts[index]} setCounts={setCounts} />
        ))}
      </div>
    </div>
  );
};

export default Base64Images; 


function _ReviewBase64 ({src, index, count, setCounts}: {src: string, index: number, count: number, setCounts: React.Dispatch<React.SetStateAction<number[]>>}) {
    console.log('ReviewBase64', index, count);
    
    return <div>
        <img key={index} src={src} alt={`Base64 Image ${index}`} style={{ width: "300px", height: "300px", margin: "5px" }} />
        <div>{count}</div>
        <button onClick={() => setCounts((prev: number[]) => {
            const newCounts = [...prev]
            newCounts[index] = count + 1
            return newCounts
        })}>+1</button>
    </div>
}

const ReviewBase64 = memo(_ReviewBase64)

